        map2.put("FUTURE_PAYMENT_LEGAL_DETAILS|AU", "<h1><strong>Fremtidig betalingsaftale</strong></h1><p>Appen kan simulere en lille prøvetransaktion for at sikre, at der kan trækkes penge på din PayPal-konto i fremtiden, men der vil ikke blive trukket nogen penge.</p><p>Din foretrukne betalingsmetode (din PayPal-saldo, din tilknyttede bankkonto eller dit betalingskort i denne rækkefølge) vil blive brugt, når du betaler med PayPal. Bemærk, at din bank eller kortudsteder muligvis opkræver et gebyr, hvis der ikke er nok penge til at dække købet med din foretrukne betalingsmetode.</p><p>Hvis du vil annullere denne aftale, skal du logge på din PayPal-konto og gå til <strong>Min profil</strong>. Klik derefter på <strong>Mine indstillinger</strong> og <strong>Skift</strong> ud for “Log på med PayPal”.</p>");
        map2.put("FUTURE_PAYMENT_LEGAL_DETAILS|BR", "<h1><strong>Fremtidig betalingsaftale</strong></h1><p>Appen kan simulere en lille prøvetransaktion for at kontrollere, at der kan trækkes penge på din PayPal-konto i fremtiden, men der vil ikke blive trukket nogen penge.</p><p>Din PayPal-saldo eller det primære betalingskort vil blive brugt, når du betaler med PayPal.</p><p>Hvis du vil annullere denne aftale, skal du logge på din PayPal-konto, gå til <strong>Min profil</strong> &gt; <strong>Mine indstillinger</strong> &gt; <strong>Log på med PayPal</strong> og fjerne denne webbutik fra listen.</p>");
        map2.put("FUTURE_PAYMENT_LEGAL_DETAILS|CN", "<h1><strong>Fremtidig betalingsaftale</strong></h1><p>Appen kan simulere en lille prøvetransaktion for at sikre, at der kan trækkes penge på din PayPal-konto i fremtiden, men der vil ikke blive trukket nogen penge.</p><p>Din foretrukne betalingsmetode vil blive brugt, når du betaler med PayPal.</p><p>Hvis du vil annullere denne aftale, skal du logge på din PayPal-konto og gå til <strong>Min profil</strong> &gt; <strong>Indstillinger</strong> &gt; <strong>Log på med PayPal</strong> og fjerne denne webbutik fra listen.</p>");
        map2.put("FUTURE_PAYMENT_LEGAL_DETAILS|GB", "<h1><strong>Fremtidig betalingsaftale</strong></h1><p>Din foretrukne betalingsmåde vil blive brugt, når du betaler med PayPal igen i denne webbutik.</p><p>Hvis du vil annullere aftalen, skal du logge på din PayPal-konto, gå til <strong>Min profil</strong> &gt; <strong>Mine indstillinger</strong> &gt; <strong>Log på med PayPal</strong> og fjerne webbutikken fra listen.</p><p>Afsnittet Faste betalinger i <a href='%s'>PayPals brugeraftale</a> gælder.</p><p>Appen kan simulere en lille prøvebetaling for at kontrollere, at du kan betale med din PayPal-konto i fremtiden, men der vil ikke blive trukket nogen penge.</p>");
